import { useState } from "react";
import { userLogin } from "../serivces/userService";
import { useNavigate } from "react-router-dom";

export const Login = () => {
    const [formData, setFormData] = useState({ field1: "", field2: "" });
    const navigate = useNavigate();

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        let result = await userLogin(formData);
        let user = { id: result.id, name: result.name, mail: result.mail };
        localStorage.setItem("user", JSON.stringify(user));
        navigate('/home');
        window.location.reload();
    };

    return (
        <div
            className="d-flex align-items-center justify-content-center vh-100"
            style={{
                background: "linear-gradient(135deg, #267294 0%, #ec8650 100%)",
                backgroundSize: "cover",
                backgroundPosition: "center"
            }}
        >
            <div
                className="login-card p-5 rounded shadow-lg text-center"
                style={{
                    backgroundColor: "rgba(255,255,255,0.95)",
                    minWidth: "320px",
                    maxWidth: "400px",
                    borderRadius: "15px",
                    boxShadow: "0 15px 40px rgba(0,0,0,0.3)"
                }}
            >
                <h2 className="mb-4" style={{ color: "#267294", fontWeight: "700" }}>התחבר</h2>
                <form onSubmit={handleSubmit}>
                    <div className="mb-3 text-start">
                        <label htmlFor="field1" className="form-label">שם משתמש</label>
                        <input
                            type="text"
                            name="field1"
                            value={formData.field1}
                            onChange={handleChange}
                            className="form-control"
                            placeholder="הכנס שם משתמש"
                            id="field1"
                            style={{ borderRadius: "8px", borderColor: "#267294" }}
                        />
                    </div>
                    <div className="mb-3 text-start">
                        <label htmlFor="field2" className="form-label">סיסמה</label>
                        <input
                            type="password"
                            name="field2"
                            value={formData.field2}
                            onChange={handleChange}
                            className="form-control"
                            placeholder="••••••••"
                            id="field2"
                            style={{ borderRadius: "8px", borderColor: "#267294" }}
                        />
                    </div>
                    <button
                        type="submit"
                        className="custom-btn btn-6 w-100"
                        style={{ marginTop: "10px" }}
                    >
                        התחבר
                    </button>
                </form>
                <p className="mt-3">
                    אין לך חשבון? <a href="/register" style={{ color: "#ec8650", fontWeight: "600" }}>הרשם כאן</a>
                </p>
            </div>
        </div>
    );
};
